import React, {Component} from 'react'
import {render} from 'react-dom'

import QrCode from 'react.qrcode.generator'

class qrCode extends Component {
  render() {
    return <div>
      <QrCode value='www.daum.com'/>
    </div>
  }
}

export default qrCode;
